import { Switch, Route } from 'react-router-dom'
import PhoneList from '../'
import PhoneDetails from '../pages/Phone/PhoneDetails'

const Routes = () => {
    return (
        <Switch>
            <Route path="/" render={() => <PhoneList />} />
            <Route path="/phone/:id" render={() => <PhoneDetails />} />
        </Switch>
    )
}

export default Routes
